import React from "react";

export default () => {
  const name = "Kyle";

  return (
    <React.Fragment>
      <div>Hi {name}, here's your financial snapshot!</div>
      <div className="ui card">
        <div className="content">
          <div className="header">Net Spend</div>
        </div>
        <div className="content">
          <h4 className="ui sub header">Income:</h4>
          <h4 className="ui sub header">Spent:</h4>
          <h4 className="ui sub header">Net:</h4>
        </div>
      </div>
    </React.Fragment>
  );
};
